import React from 'react';
import ReactDOM from 'react-dom';
import './index.scss';
import App from './App';
import * as serviceWorker from './serviceWorker';
import {WindowLevelCapture} from "./view-components/heru-tool-tip/tool-tip";

import './fonts/proximanova-reg.woff';
import './fonts/sofia-bold.woff';
import './fonts/sofia-reg.woff';
import './fonts/sofia-bold.woff';
import {ProductsData} from "./_sample-data/products-data";
import {AttributesFromProductData, AttributesService} from "./services/attributes-service";
import {ProductDataService} from "./services/product-data-service";

//initialization
export let win = new WindowLevelCapture();
win.windowEvent();

let productData = new ProductDataService();


let attributes = new AttributesFromProductData(productData.productData);
attributes.getAttributesListFromProducts();

ReactDOM.render(
  <React.StrictMode>
    <App mousePos={ {x:win.mousePos.x, y:win.mousePos.y}} />
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
